import React from 'react';
import { Container, Card, Col } from 'react-bootstrap';


const Home:React.FC = () => {
    return (
     <Container>
     <Card
          style={{ width: '18rem',border:'none' }}
          className="mt-5 text-center"
        >
          <Card.Body>
    
            <Card.Title> Hello </Card.Title>
            <Card.Text>
              I am Ionut Ciornei
            </Card.Text>
          </Card.Body>
          </Card>
          <Col xs={6} md={4} style={{position:'absolute', right:'20px', height:'200px',width:'150px', top:'70px'}}>
          <Card.Img src="/img/me.jpg"  />
        </Col> 
     </Container>      
    )
};

export default Home;
